Gini Index
I decided to add an additional information to help interpret the state of the Regionsâ Play Rates: the Gini Index.
The Gini Index is a measure of heterogeneity so, in this case and in simpler terms, how much the play rates are similar. The Index goes (when normalized like here) \(in\) [0,1] and itâs equal to 1 when thereâs a single value with 100% play rate or 0 when all play rates are equal. Of course a Gini Index of 1 needs to be avoided but itâs not like the aim should be 0. As said, itâs just to add some additional tools.
Also, the HHI is used by Dr.LoR is just another way to measure the Gini Index. So letâs also add some reproducibility / comparable numbers.
Before showing this weeks results I thought it would be better to have a generalized idea of past data. The following plot display the Gini Index over the latest 17 weeks for region frequencies by inclusion rate.



